import React from 'react';

const style={
    zIndex:'-1',
    position:'relative',
    borderLeft:"6px solid #0688FA"
}
export default function TimelineCard({iconURL,year,content}){
    return(
        <div className="d-flex flex-grow-1 flex-row  justify-content-between col-md-4">

            <p className="mb-md-0">{year} </p>

            <div style={{postion:'relative'}} className=' m-0 p-0 h-100'>
                <img style={{zIndex:'1'}} className='u-icon u-icon--md' src={iconURL} alt='icon' />
                <span style={style}></span>
            </div>
            <p className="">
                {content}
            </p>
        </div>
    )
}
